import React from 'react'
import {Container} from 'react-bootstrap'

const LoggedInHomescreen = ({name}) => {
    return (
        <div style={{"minHeight": "83vh"}}>
            <Container>
                Welcome, {name}!
            </Container>
        </div>
    )
}

export default LoggedInHomescreen
